import{_ as e,c as r,o,ae as i}from"./chunks/framework.DO_qJNgM.js";const b=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"interview/work.md","filePath":"interview/work.md"}'),t={name:"interview/work.md"};function l(s,a,n,d,h,v){return o(),r("div",null,a[0]||(a[0]=[i('<h2 id="javase" tabindex="-1">JavaSE <a class="header-anchor" href="#javase" aria-label="Permalink to &quot;JavaSE&quot;">​</a></h2><p><code>JavaSE</code>是Java平台的标准版，是Java技术的核心与基础。它提供了开发和运行Java应用程序所需的核心API、工具和运行环境，适用于桌面应用、命令行工具、服务器端应用等。<code>JavaSE</code>是学习Java编程的起点，也是其他版本（如<code>JavaEE</code>、<code>JavaMe</code>的基础）。</p><h3 id="javase的核心组成" tabindex="-1">JavaSE的核心组成 <a class="header-anchor" href="#javase的核心组成" aria-label="Permalink to &quot;JavaSE的核心组成&quot;">​</a></h3><ol><li>Java语言基础：包括语法、<strong>面向对象编程（类、对象、继承、多态）</strong>、异常处理、泛型等。</li><li>核心类库（<code>Java Class Library</code>）:</li></ol><blockquote><p>基础工具：java.lang（如字符串、多线程）、java.util（集合、日期）。<br>输入输出：java.io（文件读写）。<br> 网络编程：java.net（Socket、HTTP请求）。<br> GUI开发：Java.awt、java.swing（桌面图形界面，现逐渐被其他技术替代）。<br>数据库连接：JDBC（Java Database Connectivity）。</p></blockquote><ol start="3"><li>Java虚拟机（JVM）：负责执行编译后的Java字节码（.class文件），实现跨平台运行。</li><li>开发工具：</li></ol><blockquote><p>JDK：包含编译器（javac）、调试器、JRE和其他开发工具。<br> JRE：仅包含运行Java程序所需的JVM和基础类库。</p></blockquote><h3 id="javase的应用场景" tabindex="-1">JavaSE的应用场景 <a class="header-anchor" href="#javase的应用场景" aria-label="Permalink to &quot;JavaSE的应用场景&quot;">​</a></h3><ol><li>桌面应用程序：如使用Swing或JavaFX开发的图形界面工具。</li><li>命令行工具：如构建脚本、数据处理工具（如Maven、Gradle底层依赖JavaSE）。</li><li>服务器端应用：基于Socket、HTTP的网络服务（如小型Web服务或中间件）。</li></ol><h3 id="javase的特点" tabindex="-1">JavaSE的特点 <a class="header-anchor" href="#javase的特点" aria-label="Permalink to &quot;JavaSE的特点&quot;">​</a></h3><ol><li>跨平台性：通过JVM实现&#39;一次编写，到处运行&#39;（依赖不同系统的JVM版本）。</li><li>自动内存管理：垃圾回收（GC）机制自动回收无用对象，减少内存泄露风险。</li><li>丰富的类库：提供大量开箱即用的API，简化开发（如集合操作、多线程、网络通信）。</li><li>多线程支持：内置<code>Thread</code>类和并发工具（<code>java.util.concurrent包</code>），方便编写高并发程序。</li></ol><h3 id="javase-vs-javaee-vs-javame" tabindex="-1">JavaSE vs JavaEE vs JavaMe <a class="header-anchor" href="#javase-vs-javaee-vs-javame" aria-label="Permalink to &quot;JavaSE vs JavaEE vs JavaMe&quot;">​</a></h3><blockquote><p>JavaSE：标准版，通用编程基础。<br> JavaEE（现Jakarta EE）：企业版，扩展了Web和企业级功能（如Servlet、JPA、EJB）。<br> JavaME：微型版，针对嵌入式设备和移动终端（现已逐渐被Android取代）。</p></blockquote><h3 id="反射" tabindex="-1">反射 <a class="header-anchor" href="#反射" aria-label="Permalink to &quot;反射&quot;">​</a></h3><p style="text-indent:2em;">反射即创建一个类的实例，然后获取其元数据（包括类名、包名、字段、方法）。反射在我们日常开发中根本用不上，并非为了改善业务和功能，反射是用代码控制代码，spring、Mybatis等插件都离不开反射，正是有了反射，插件才能取用代码控制代码</p><br><br><h2 id="java-web" tabindex="-1">Java Web <a class="header-anchor" href="#java-web" aria-label="Permalink to &quot;Java Web&quot;">​</a></h2><h3 id="cookie" tabindex="-1">cookie <a class="header-anchor" href="#cookie" aria-label="Permalink to &quot;cookie&quot;">​</a></h3><h3 id="session" tabindex="-1">session <a class="header-anchor" href="#session" aria-label="Permalink to &quot;session&quot;">​</a></h3><br><br><h2 id="spring框架" tabindex="-1">Spring框架 <a class="header-anchor" href="#spring框架" aria-label="Permalink to &quot;Spring框架&quot;">​</a></h2><p>ssm框架</p><br><br><h2 id="spring-mvc" tabindex="-1">Spring MVC <a class="header-anchor" href="#spring-mvc" aria-label="Permalink to &quot;Spring MVC&quot;">​</a></h2><p>简单了解一下</p><br><br><h2 id="mybatis" tabindex="-1">mybatis <a class="header-anchor" href="#mybatis" aria-label="Permalink to &quot;mybatis&quot;">​</a></h2><p>了解一下怎么使用</p><br><br><h2 id="springboot" tabindex="-1">SpringBoot <a class="header-anchor" href="#springboot" aria-label="Permalink to &quot;SpringBoot&quot;">​</a></h2><br><br><h2 id="redis" tabindex="-1">redis <a class="header-anchor" href="#redis" aria-label="Permalink to &quot;redis&quot;">​</a></h2><br><br><h2 id="复习八股文和项目相关" tabindex="-1">复习八股文和项目相关 <a class="header-anchor" href="#复习八股文和项目相关" aria-label="Permalink to &quot;复习八股文和项目相关&quot;">​</a></h2><p>八股文就复习跟Java相关的，主要有集合、以及面向对象概念、多线程基础、jvm基础（垃圾回收、内存运行区域）、mysql+redis</p><br><br><h2 id="微服务" tabindex="-1">微服务 <a class="header-anchor" href="#微服务" aria-label="Permalink to &quot;微服务&quot;">​</a></h2>',45)]))}const J=e(t,[["render",l]]);export{b as __pageData,J as default};
